import '../Styles/flies.css'
import React, { useState } from "react";
import FlyPopUp from './FlyPopUp';

function Flies({flies}) {

    const [selectedType, setSelectedType] = useState('')
    const [selectedFly, setSelectedFly] = useState([])
    const [selectedCycle, setSelectedCycle] = useState('')
    const [selectedSpecies, setSelectedSpecies] = useState('')

    function filterFliesType() {
        let sortedFlies;

        if(selectedType === 'Dry Flies' && selectedCycle === '' && selectedSpecies === '') {
            sortedFlies = [...flies].filter(fly => fly.fly_type == 'Dry')
        } else if(selectedType === 'Dry Flies' && selectedCycle === 'Nymph' && selectedSpecies === '') {
            sortedFlies = [...flies].filter(fly => fly.fly_type == 'Dry' && fly.fly_life_cycle == 'Nymph')
        } else if(selectedType === 'Dry Flies' && selectedCycle === 'Emerger' && selectedSpecies === '') {
            sortedFlies = [...flies].filter(fly => fly.fly_type == 'Dry' && fly.fly_life_cycle == 'Emerger')
        } else if(selectedType === 'Dry Flies' && selectedCycle === 'Adult' && selectedSpecies === '') {
            sortedFlies = [...flies].filter(fly => fly.fly_type == "Dry" && fly.fly_life_cycle == "Adult")
        } 


        else if(selectedType === 'Dry Flies' && selectedCycle === '' && selectedSpecies === 'Mayfly') {
            sortedFlies = [...flies].filter(fly => fly.fly_type == 'Dry' && fly.fly_imitation == 'Mayfly')
        } else if(selectedType === 'Dry Flies' && selectedCycle === '' && selectedSpecies === 'Caddis') {
